import React from 'react';
import axios from 'axios';

const Cart = ({ cart }) => {
  const checkout = () => {
    axios.post("http://localhost:5000/api/cart/add", cart);
  };

  return (
    <div>
      <h2>Cart</h2>
      <button onClick={checkout}>Proceed to Checkout</button>
    </div>
  );
};

export default Cart;
